import React from "react";
import EventsList from "../components/EventsList";

const dummyEvents = [{ id: "e1", title: "event1 ", date: "01/01/2000" }];

const EventsPage = () => {
  return (
    <>
      <h1>Events</h1>
      <EventsList />
    </>
  );
};

export default EventsPage;
